import React, { useEffect, useState } from 'react';
import Nav from '../Nav/Nav';
import axios from 'axios';
import User from '../User/User'; // <-- Add this import

const URL = 'http://localhost:5000/api/userDetails';

const fetchHandler = async () => {
  return await axios.get(URL)
    .then(response => response.data);
};

function UserDetails() {
  const [userDetails, setUserDetails] = useState([]); // <-- Initialize as array

  useEffect(() => {
    fetchHandler()
      .then(data => setUserDetails(data.userDetails))
      .catch(error => console.error('Error fetching user details:', error));
  }, []);

  return (
    <div>
      <Nav />
      <h1>User Details</h1>
      {userDetails && userDetails.map((user, i) => (
        <div key={i}>
          <User user={user} />
        </div>
      ))}
    </div>
  );
}

export default UserDetails;
